import React from "react";
import "./style.css";
function Form(props) {
  var massiv = ["haha", "sfasda"];
  massiv.length = 7;
  const dummy = () => {
    massiv[props.id] = document.getElementById(props.id).value;
    console.log(document.getElementById(props.id).value);
  };

  return (
    <div>
      <input
        className="orolt"
        type="text"
        placeholder={props.placeholder}
        id={props.id}
        onChange={dummy}
      />
    </div>
  );
}
export default Form;
